function BemVindo(props) {
  return <h1>Olá, {props.nome}! Você tem {props.idade} anos.</h1>
}

function App() {
   return <>
    <BemVindo nome = "Rodrigo" idade= "40"/>
    <BemVindo nome = "Matheus" idade= "1"/>
    <BemVindo nome = "Luanna" idade= "20"/>
   </>
}

export default App;
